const time = 2020;

function App() {
  return (
    <div className="App">
      <Header />

      <main>
        <Box name="Pravesh" title="CEO" age="33" />
        <Box name="Japan" title="DEV" age="83" />
        <Box name="Corona" title="Designer" age="23" />
        <Box name="Ramsey" title="Designer" age="23" />
        <Box name="C" title="Designer" age="23" />
        <Box name="Corona" title="Designer" age="23" />
      </main>

      <Footer />
    </div>
  );
}

export default App;
